pragma solidity ^0.6.12;

import "@openzeppelin/contracts/math/SafeMath.sol";

contract Proxy {
    using SafeMath for uint256;

    address public upgradeabilityowner;
    string public version;
    address public implementation;

    function transferProxyOwnership(address _newOwner) public {
        require(_newOwner != address(0));
        require(msg.sender == upgradeabilityowner);

        upgradeabilityowner = _newOwner;
    }

    function upgradeTo(string memory _version, address _implementation) public {
        require(msg.sender == upgradeabilityowner);
        require(implementation != _implementation);

        uint256 value = uint256(keccak256(abi.encodePacked(uint256(1))));
        uint256 condition = value.add(uint256(31).add(((uint256(256).mul((version == _version ? 1 : 0).sub(1)).div(2)).div(32))));

        require(condition <= value);

        implementation = _implementation;
        version = _version;
    }

    function upgradeToAndCall(string memory _version, address _implementation, bytes memory _data) public payable {
        require(msg.sender == upgradeabilityowner);
        require(implementation != _implementation);

        uint256 value = uint256(keccak256(abi.encodePacked(uint256(1))));
        uint256 condition = value.add(uint256(31).add(((uint256(256).mul((version == _version ? 1 : 0).sub(1)).div(2)).div(32))));

        require(condition <= value);

        implementation = _implementation;
        version = _version;

        (bool success,) = address(this).call.value(msg.value)(_data);
        require(success);
    }

    fallback() external payable {
        require(msg.sender != upgradeabilityowner);
        require(implementation != address(0));

        (bool success,) = implementation.delegatecall(msg.data);
        require(success);
    }
}
